function toArgs(line) {
    var args = line.split(";");
    var start = parseInt(args[0].split("(")[1].split(",")[0]);
    var end = parseInt(args[0].split(")")[0].split(",")[1]);

    var terminals = [];

    var routes = args.slice(1).map(function (route) {
        var rargs = route.split("=");
        var routeName = rargs[0].trim();
        var stops = rargs[1].split("[")[1]
            .split("]")[0]
            .split(",")
            .map(function (s) { return parseInt(s.trim()); })
            .map(function (id) { return { id: id, route: routeName, links: [] }; });

        stops.forEach(function (stop, stopIndex) {

            var stopTerminal = terminals[stop.id];

            if (stopTerminal === undefined) {
                terminals[stop.id] = { id: stop.id, stops: [stop] };
                stop.terminal = terminals[stop.id];
            }
            else {
                stopTerminal.stops.push(stop);
                stop.terminal = stopTerminal;
            }

            if (stopIndex > 0) { stop.links.push(stops[stopIndex - 1]); }

            if (stopIndex < stops.length - 1) { stop.links.push(stops[stopIndex + 1]); }
        });

        return stops;
    });

    var mergedRoutes = [].concat.apply([], routes);

    var startTerminal = terminals[start];
    var endTerminal = terminals[end];

    return { start: start, end: end, startStops: startTerminal.stops, endStops: endTerminal.stops, stops: mergedRoutes };
}

function updateDistanceIfShorter(stops, distance) {
    stops.forEach(function (stop) { if (distance < stop.distance) { stop.distance = distance; stop.visited = false; } });
}

function sortByDistance(a, b) {
    return a.distance > b.distance ? 1 : (a.distance < b.distance ? -1 : 0);
}

function nodeReached(stops) {
    var reached = stops
        .filter(function (stop) { return stop.distance < Number.POSITIVE_INFINITY; })
        .sort(sortByDistance);

    return reached.length === 0 ? undefined : reached[0];
}

function stopCanBeVisited(stop) { return stop.distance != Number.POSITIVE_INFINITY && stop.visited !== true; }

function setInitialDistance(stops, startId) {
    stops.forEach(function (stop) {
        //1.Assign to every node a tentative distance value: set it to zero for our initial node and to infinity for all other nodes.
        if (stop.id == startId) { stop.distance = 0; }
        else { stop.distance = Number.POSITIVE_INFINITY; }
    });
}

function getNextNode(unvisitedSet) {
    return unvisitedSet
            .filter(stopCanBeVisited)
            .sort(sortByDistance)[0];
}

function processStops(current, unvisitedSet, endStops)
{
    while (true) {

        /*
        3.For the current node, consider all of its unvisited neighbors and calculate their tentative distances. 
        Compare the newly calculated tentative distance to the current assigned value and assign the smaller one. 
        For example, if the current node A is marked with a distance of 6, and the edge connecting it with a
        neighbor B has length 2, then the distance to B (through A) will be 6 + 2 = 8. If B was previously marked 
        with a distance greater than 8 then change it to 8. Otherwise, keep the current value.
        */

        // links on the same route - it takes a bus 7 minutes to ride between the adjacent stops
        updateDistanceIfShorter(current.links, current.distance + 7);

        // links to other routes - it takes 12 minutes for you to change a bus.
        updateDistanceIfShorter(current.terminal.stops, current.distance + 12);

        /* 4.When we are done considering all of the neighbors of the current node, mark the current node as visited and 
            remove it from the unvisited set. A visited node will never be checked again.
        */
        //removeCurrent(unvisitedSet, current);
        current.visited = true;

        /*
        5.If the destination node has been marked visited (when planning a route between two specific nodes) or if the smallest 
        tentative distance among the nodes in the unvisited set is infinity (when planning a complete traversal; 
        occurs when there is no connection between the initial node and remaining unvisited nodes), then stop. The algorithm has finished.
        */
        var endStop = nodeReached(endStops);
        if (endStop !== undefined) { return endStop.distance.toString(); }

        current = getNextNode(unvisitedSet);
        if (current === undefined) { return "None"; }

        //6.Otherwise, select the unvisited node that is marked with the smallest tentative distance, set it as the new "current node", and go back to step 3.
    }

    return "None";
}

function aBusNetwork(line) {

    var args = toArgs(line);

    //2.Set the initial node as current. Mark all other nodes unvisited. Create a set of all the unvisited nodes called the unvisited set.
    setInitialDistance(args.stops, args.start);

    var current = args.startStops[0];

    return processStops(current, args.stops, args.endStops);
}


